window.bookSummaryJSON = "<p><i>Cole has ventured into Hell’s Heart.</i></p> <p><i>I won’t let him go alone.</i></p> <p><i>Now that I know the answer to our bonds...it’s time to save them all.</i></p> <p>* * *</p> <p>My mates have been asleep for too long. When Raze gives me the good news that they’ve broken free of Calamity’s grip, my heart soars to the heavens.</p> <p>But when I realize they aren’t the mates that I left behind, my soul cracks into a thousand pieces.</p> <p>They are lost to Calamity’s madness and have joined Lucifer’s side in this war.</p> <p>The Dean wants them dead. After everything they’ve done for the Academy, I will go rogue if I have to in order to stop a massacre.</p> <p>It’ll take a dangerous journey to save them and to stop Lucifer’s plans before it’s too late.</p> <p>I refuse to lose them.</p> <p>I refuse to break.</p> <p>Even if it means venturing into the dark… and never coming out again.</p> <p><i>Fortune Academy Underworld: Book Eight </i>is the exciting new installment of Lily's journey through Hell, Heaven, and beyond! This is a paranormal romance with multiple love interests.</p> <p>Audiobook exclusive included: <i>Burn in Ruin</i></p>"; 
